INSERT INTO `synaylies` VALUES ('1', 'Eminem', 'ΣΕΦ', '2016-07-10 20:00:00', '6500', , 'Marshall Bruce Mathers III (born October 17, 1972), known professionally as Eminem, is an American rapper, songwriter, record producer, and actor from Detroit, Michigan. In addition to his solo career, he is a member of D12 and half of the hip-hop duo Bad Meets Evil. Eminem is the best-selling artist of the 2000s in the United States. Rolling Stone ranked him 83rd on its list of 100 Greatest Artists of All Time, calling him the King of Hip Hop.\n', '500', '1500', '4500');
INSERT INTO `synaylies` VALUES ('2', 'Φλωρινιώτης', 'ΑΓΡΙΜΙΑ', '2016-08-06 00:00:00', '0', , 'Ο Γιάννης Αποστολίδης, γνωστός ως Γιάννης Φλωρινιώτης, γεννήθηκε στις 15 Φεβρουαρίου του 1947 στη Φλώρινα. Ξεκίνησε να τραγουδάει σε ηλικία 14 ετών. Αργότερα βρέθηκε στη Θεσσαλονίκη, όπου τραγούδησε δίπλα σε μεγάλους ρεμπέτες, όπως Μάρκος Βαμβακάρης, Γιάννης Παπαϊωάννου, Γιώργος Λούκας, Πρόδρομος Τσαουσάκης, Θεόδωρος Πολυκανδριώτης και με τη Ρίτα Σακελλαρίου. Το 1970-71, έρχεται για πρώτη φορά στην Αθήνα. Δουλεύει σε διάφορα κέντρα, τραγουδώντας χορεύοντας και ντυμένος εκκεντρικά. Όπου εμφανίζεται έχει μεγάλη επιτυχία, αλλά δέχεται και σκληρή κριτική. Στη δισκογραφία, κάνει την πρώτη του εμφάνιση με το άλμπουμ \"Τώρα Θέλω Τώρα\", που αμέσως γίνεται χρυσό.\n', '0', '0', '0');
INSERT INTO `synaylies` VALUES ('3', 'Justin Timberlake', 'ΜΑΛΑΚΑΣΑ', '2016-06-05 00:00:00', '6000', , 'Justin Randall Timberlake (born January 31, 1981) is an American singer, songwriter, actor, and record producer. He appeared on the television shows Star Search and The All-New Mickey Mouse Club as a child. In the late 1990s, Timberlake rose to prominence as one of the two lead vocalists and youngest member of NSYNC, which eventually became one of the best-selling boy bands of all time. During the group\'s hiatus, Timberlake released his debut studio album Justified (2002), which included the successful singles \"Cry Me a River\" and \"Rock Your Body\", and earned his first two Grammy Awards.\n', '1000', '5000', '0');
INSERT INTO `synaylies` VALUES ('4', 'Accept', 'OAKA', '2016-09-09 00:00:00', '8000', , 'Accept is a German heavy metal band from the town of Solingen, originally assembled by former vocalist Udo Dirkschneider, guitarist Wolf Hoffmann and bassist Peter Baltes. Their beginnings can be traced back to the late 1960s. The band played an important role in the development of speed and thrash metal, being part of the German heavy metal scene, which emerged in the early to mid-1980s. Accept achieved commercial success with their fifth studio album Balls to the Wall (1983), which is the band\'s only album to be certified gold in the United States and Canada, and spawned their well-known hit \"Balls to the Wall\".\n', '1000', '2000', '5000');
INSERT INTO `synaylies` VALUES ('5', 'Iron Maiden', 'OAKA', '2016-06-13 00:00:00', '13000', , 'Iron Maiden are an English heavy metal band formed in Leyton, east London, in 1975 by bassist and primary songwriter Steve Harris. The band\'s discography has grown to thirty-eight albums, including sixteen studio albums, eleven live albums, four EPs, and seven compilations.\n', '1000', '2000', '10000');
INSERT INTO `synaylies` VALUES ('6', 'Iron Maiden', 'OAKA', '2016-06-14 20:00:00', '13000', , 'Iron Maiden are an English heavy metal band formed in Leyton, east London, in 1975 by bassist and primary songwriter Steve Harris. The band\'s discography has grown to thirty-eight albums, including sixteen studio albums, eleven live albums, four EPs, and seven compilations.\n', '1000', '2000', '10000');
INSERT INTO `synaylies` VALUES ('7', 'Iron Maiden', 'OAKA', '2016-06-15 20:00:00', '13000', , 'Iron Maiden are an English heavy metal band formed in Leyton, east London, in 1975 by bassist and primary songwriter Steve Harris. The band\'s discography has grown to thirty-eight albums, including sixteen studio albums, eleven live albums, four EPs, and seven compilations.\n', '1000', '2000', '10000');
INSERT INTO `synaylies` VALUES ('8', 'Εφη Θωδη', 'Δισκο Πλατο', '2016-03-30 21:00:00', '5000', , 'Efi Thodi (Greek: Έφη Θώδη; 1964) is a Greek pop singer who specializes in traditional Greek and pop music. She was born and raised in Karditsa. Her music career commenced in 1984. Her first songs were in Greek and had a traditional style that she used up and until 2006.\n\nSince March 2009, Thodi makes television appearances claiming that she discovered a special spiritual power inside her that enables her to help and heal people. She also claimed that she had seen divine visions.[1][2] to the dismay of her family[3]\n\nAs of May 2009, the above led Thodi to a mental illness clinic of Sismanogleion hospital.[4]', '0', '0', '5000');
INSERT INTO `synaylies` VALUES ('9', 'Τερλεγκας', 'Αγριμια', '2016-09-05 00:00:00', '1000', , 'Γεννήθηκε στο Πεύκο Καλαβρύτων. Από νωρίς φάνηκε η κλίση του στο τραγούδι. Σε ηλικία μόλις δεκατριών ετών ξεκίνησε να τραγουδά διπλά σε μεγάλα ονόματα της εποχής. Ήρθε στην Αθήνα όταν ήταν δεκαέξι ετών και από τότε ακολούθησε καριέρα στο τραγούδι.\n\nΣτην καλλιτεχνική πορεία του συνεργάστηκε με τους: Μάνο Ελευθερίου, Χρήστο Νικολόπουλο, Ιφιγένεια Γιαννοπούλου, Ρίτα Σακελλαρίου, Τζένη Βάνου, Πίτσα Παπαδοπούλου, Ζαφείρη Μελά, Κώστα Μπίγαλη κ.ά.\n\nΤα περισσότερα τραγούδια που εχει τραγουδήσει έχουν και την υπογραφή του. Μπορεί και παίζει όλα τα έγχορδα όργανα, ενώ έχει την εξ ολοκλήρου επιμέλεια της παραγωγής.\n\nΖει στην Παιανία με τους 3 γιους και τη μητέρα του.', '0', '0', '1000');
INSERT INTO `synaylies` VALUES ('10', 'MOTORHEAD', 'HELL', '2016-06-06 00:00:00', '73998', , 'Motörhead (/ˈmoʊtərhɛd/) were an English rock band formed in June 1975 by bassist, singer, and songwriter Ian Fraser \"Lemmy\" Kilmister, who was the sole constant member. The band is often considered a precursor to, or one of the earliest members of, the New Wave of British Heavy Metal, which re-energised heavy metal in the late 1970s and early 1980s.[1] Despite this, Lemmy always dubbed their music as simply \"rock and roll\".\n\nMotörhead released 23 studio albums, 10 live recordings, 12 compilation albums, and five EPs over a career spanning 40 years. Usually a power trio, they had particular success in the early 1980s with several successful singles in the UK Top 40 chart. The albums Overkill, Bomber, Ace of Spades, and particularly No Sleep \'til Hammersmith cemented Motörhead\'s reputation as a top-tier rock band.[2] The band are ranked number 26 on VH1\'s 100 Greatest Artists of Hard Rock.[3] As of 2012, they have sold more than 15 million albums worldwide.[4]\n\nMotörhead are typically classified as heavy metal, and their fusion of punk rock into the genre helped to pioneer speed metal and thrash metal. Their lyrics typically covered such topics as war, good versus evil, abuse of power, promiscuous sex, substance abuse, and, most famously, gambling.\n\nLemmy died on 28 December 2015 after being diagnosed with an undisclosed \"aggressive\" form of cancer. Drummer Mikkey Dee and guitarist Phil Campbell both confirmed that Motörhead would not continue as a band.[5][6][7]', '666', '6666', '66666');
